  const splitData = (data, trainingRange) => {
    const chunk = data.slice(
      trainingRange[0] === 0 ? 0 : Math.ceil(trainingRange[0] * data.length),
      Math.floor(trainingRange[1] * data.length)
    );
    return {
      times: chunk.map((e1) => e1[0]),
      inputs: chunk.map((e1) => e1[1].set.map((e1) => e1[4])),
      outputs: chunk.map((e1) => e1[1].value),
      window_size: chunk[0][1].set.length,
    };
  };

  const onClickTrainModel = async () => {
    setIsModelTraining(true);
    setModelResultTraining(null);
    let n_epochs = 3;
    let learningrate = 0.01;
    let n_hiddenlayers = 4;

    const { times, inputs, outputs, window_size } = splitData(
      dataSma50,
      [0, 0.7]
    );

    const result = await trainModel(
      inputs,
      outputs,
      window_size,
      n_epochs,
      learningrate,
      n_hiddenlayers
    );

    setIsModelTraining(false);
    setModelResultTraining(result);
  };

  const trainModel = async (
    X,
    Y,
    window_size,
    n_epochs,
    learning_rate,
    n_layers
  ) => {
    const batch_size = 32;

    // input dense layer
    const input_layer_shape = window_size;
    const input_layer_neurons = 64;

    // LSTM
    const rnn_input_layer_features = 16;
    const rnn_input_layer_timesteps =
      input_layer_neurons / rnn_input_layer_features;
    const rnn_input_shape = [
      rnn_input_layer_features,
      rnn_input_layer_timesteps,
    ]; // the shape have to match input layer's shape
    const rnn_output_neurons = 16; // number of neurons per LSTM's cell

    // output dense layer
    const output_layer_shape = rnn_output_neurons; // dense layer input size is same as LSTM cell
    const output_layer_neurons = 1; // return 1 value

    // ## old method
    // const xs = tf.tensor2d(X, [X.length, X[0].length])//.div(tf.scalar(10));
    // const ys = tf.tensor2d(Y, [Y.length, 1]).reshape([Y.length, 1])//.div(tf.scalar(10));

    // ## new: load data into tensor and normalize data
    const inputTensor = tf.tensor2d(X, [X.length, X[0].length]);
    const labelTensor = tf.tensor2d(Y, [Y.length, 1]).reshape([Y.length, 1]);

    const [xs, inputMax, inputMin] = normalizeTensorFit(inputTensor);
    const [ys, labelMax, labelMin] = normalizeTensorFit(labelTensor);

    // ## define model

    const model = tf.sequential();

    model.add(
      tf.layers.dense({
        units: input_layer_neurons,
        inputShape: [input_layer_shape],
      })
    );
    model.add(tf.layers.reshape({ targetShape: rnn_input_shape }));

    let lstm_cells = [];
    for (let index = 0; index < n_layers; index++) {
      lstm_cells.push(tf.layers.lstmCell({ units: rnn_output_neurons }));
    }

    model.add(
      tf.layers.rnn({
        cell: lstm_cells,
        inputShape: rnn_input_shape,
        returnSequences: false,
      })
    );

    model.add(
      tf.layers.dense({
        units: output_layer_neurons,
        inputShape: [output_layer_shape],
      })
    );

    model.compile({
      optimizer: tf.train.adam(learning_rate),
      loss: "meanSquaredError",
    });

    // ## fit model
    setModelLogs([]);
    modelLogsRef.current = [];
    const hist = await model.fit(xs, ys, {
      batchSize: batch_size,
      epochs: n_epochs,
      callbacks: {
        onEpochEnd: (epoch, log) => {
          modelLogsRef.current.push(`Epoch: ${epoch + 1} ; loss: ${log.loss}`);
          setModelLogs([...modelLogsRef.current]);
        },
      },
    });

    // return { model: model, stats: hist };
    return {
      model: model,
      stats: hist,
      normalize: {
        inputMax: inputMax,
        inputMin: inputMin,
        labelMax: labelMax,
        labelMin: labelMin,
      },
    };
  };

  const makePredictions = (X) => {
    X = tf.tensor2d(X, [X.length, X[0].length]);
    const normalizedInput = normalizeTensor(
      X,
      modelResultTraining.normalize["inputMax"],
      modelResultTraining.normalize["inputMin"]
    );
    const model_out = modelResultTraining.model.predict(normalizedInput);
    const predictedResults = unNormalizeTensor(
      model_out,
      modelResultTraining.normalize["labelMax"],
      modelResultTraining.normalize["labelMin"]
    );

    return Array.from(predictedResults.dataSync());
  };

